import {Link} from 'react-router-dom'
export default function Navbar() {
    return (

      <div className="nav-top">
      <Link to="/">ACCUEIL</Link>
      <Link to="/Portfolio">Portfolio</Link>
      <Link to="/About">About</Link>
      <Link to="/Contact">Contact</Link>
      </div>
)
}
